import React from "react";

export default class Card extends React.Component {
  render() {
    var page = this.props.page;
    return (
      <div
        class="card mb-auto mt-auto"
        style={{
          width: "18rem",
          backgroundColor: "#373737",
          paddingTop: "510%"
        }}
      >
        <div class="card-body">
          <h5 class="card-title">
            <b>
              <span style={{ color: "yellow" }}>{this.props.course}</span>{" "}
              <span style={{ color: "white" }}>
                {this.props.code} -{" "}
                <span style={{ fontWeight: "lighter" }}>
                  {this.props.name}{" "}
                </span>
                <span
                  style={{
                    fontWeight: "lighter",
                    fontSize: "0.9em"
                  }}
                >
                  {" "}
                  <br />
                  {this.props.positions}
                  <br />
                </span>
              </span>
            </b>
          </h5>
          <h6 class="card-subtitle mb-2 text-white">{this.props.duration}</h6>
          <p class="card-text text-white">{this.props.duties}</p>
          <a href={"#" + page} class="card-link">
            About the course
          </a>
        </div>
      </div>
    );
  }
}
